import React from 'react';
import './SaveSessionsPanel.css';

class SaveSessionsPanel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
        <form id="Input" onSubmit={this.props.saveSession}>
            <input type="text" onChange={this.props.updateSessionName} />
        </form>
        );
    }
}

export default SaveSessionsPanel;
